import './App.css';
import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import Home from "./"

function App() {
  return (
    <BrowserRouter>
    <div className='App'>
      <ToastContainer>
        <Switch>
          <Route exact path="/" component={Home}/>
        </Switch>
      </ToastContainer>
    </div>
    </BrowserRouter>

  );
}

export default App;
